"      Norflex (AE, AU, BB, BE, BH, BM, BS, BZ, CH, CR, CY, DE, DO, EG, FI, GR, GT, GY, HK, HN, IE, IL, IQ, IR, JM, JO, KE, KW, LB, LU, LY, MU, MX, MY, NG, NL, NZ, OM, PA, PE, PK, PT, QA, SA, SE, SR, SV, SY, TH, TT, TW, UY, VE, YE, ZA);",
