"     </li>",
"     <li>",
"      Orpherin (KP);",
"     </li>",
"     <li>",
"      Orphipal (IN);",
"     </li>",
"     <li>",
"      Phemax (TH);",
"     </li>",
"     <li>",
"      Plenactol (CN);",
"     </li>",
"     <li>",
"      Relaflex (GT, HN, NI, SV);",
"     </li>",
"     <li>",
"      Slakin (KP)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F203960\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Indirect skeletal muscle relaxant thought to work by central atropine-like effects; has some euphorigenic and analgesic properties",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F203976\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of effect: Peak effect: Oral: 2-4 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: 4-6 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 20%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Extensively hepatic",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 14-16 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Primarily urine (8% as unchanged drug)",
"    </p>",
"   </div>",
"  </div>",
