var title_f35_11_36022="Gastric xanthoma CPC Light";
var content_f35_11_36022=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F51475&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F51475&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Gastric xanthoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 385px; height: 567px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    At low power (upper panel), the lamina propria of the surface/foveolar zone is expanded by a cellular infiltrate. The epithelium is normal. At high power (lower panel), the infiltrate consists of cells with small central benign nuclei and copious faintly basophilic cytoplasm. On immunostaining, these cells are CD68-positive, thus defining them as macrophages. The cytoplasm contains phagocytized lipid material. The appearance is typical of a gastric xanthoma. Similar endoscopic findings are seen in granular cell tumors and muciphages. Gastric xanthomas are sessile, yellow nodules, usually diminutive (&lt;5 mm) in size, confined to the mucosa. This represents accumulation of lipid in macrophages. Gastric xanthomas have no malignant potential.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Heather Crowley, MD and Donald Antonioli, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
