" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Classification and clinical features of diabetic retinopathy",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
