"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dietary disorders (eg, low calcium intake, eating disorders)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Family history of osteopenia or osteoporosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Poor body biomechanics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Female gender",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Menstrual irregularity in females",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prolonged glucocorticoid use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Factors of uncertain risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Shoe type",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Foot anatomy (eg, extreme high arch)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Muscle inflexibility",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Low testosterone levels in men",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Factors disproven as risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Running surface",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
